import React, { Component } from 'react'
import UserElement from '../UserElement'
import './index.css'

export default class List extends Component {
    render() {
        const {userList, isFirst, isLoading, err} = this.props;
        return (
            <div className="row">
                is
                {
                    userList.map(user => {
                        return (<UserElement key={user.id} {...user}/>)
                    })
                }
            </div>
        )
    }
}
